(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-2d0b9d1e"],{3528:function(r,n,e){"use strict";e.r(n);var t=e("7a23");function o(r,n,e,o,c,i){var s=Object(t["resolveComponent"])("v-md-preview");return Object(t["openBlock"])(),Object(t["createElementBlock"])("div",null,[Object(t["createVNode"])(s,{text:o.md},null,8,["text"])])}var c='\x3c!--\r\n * @Author: snltty\r\n * @Date: 2021-09-07 00:37:53\r\n * @LastEditors: snltty\r\n * @LastEditTime: 2021-09-22 17:43:27\r\n * @version: v1.0.0\r\n * @Descripttion: 功能说明\r\n * @FilePath: \\client.web.vue3\\src\\views\\about\\home.md\r\n--\x3e\r\n\r\n# p2p-tunnel\r\n\r\n1. .NET5 Socket编程实现内网穿透\r\n2. UDP,TCP打洞实现点对点直连\r\n3. 访问内网web，内网桌面，及其它TCP上层协议服务\r\n4. 服务端只承受 客户端注册，客户端信息的交换。不承受数据转发，几乎无压力\r\n\r\n# 项目结构\r\n1. p2p  打洞项目\r\n    1. client 客户端公共内容\r\n    2. client.service 客户端服务\r\n    3. client.service.album 客户端服务的 图片相册插件\r\n    4. client.service.fileserver 客户端服务的  文件服务插件\r\n    5. client.service.tcpforward 客户端服务的 tcp转发插件\r\n    6. common 一些公共的功能\r\n    7. server 服务器\r\n    8. server.service 打洞服务器的服务端\r\n2. platform 跟平台有关的一些实验项目\r\n    1. win  windows特有的\r\n        1. remoteDektop 远程桌面相关\r\n            1. mstsc.manager 远程桌面管理\r\n            2. rdp.desktop rdp协议的桌面共享\r\n            3. rdp.viewer rdp协议的桌面共享查看器\r\n3. testing  尝试中的项目\r\n    1. audio.test 音频测试\r\n    2. NSpeex 音频压缩\r\n    3. ozeki 降噪 回音消除\r\n    4. mstsc.manager windows远程桌面管理\r\n    5. rdp.desktop rdp 桌面共享 \r\n    6. rdp.viewer  rdp 桌面共享查看器\r\n4. client.web.vue3 客户端管理界面\r\n\r\n\r\n# 一些特殊的地方\r\n1. 如果你使用<font color="red">虚拟机</font>，请将<font color="red">虚拟机</font>网络设置为 **【桥接模式】**，虚拟机使用物理网络\r\n2. 源码都是开源的，默认提供的服务器会对 **【分组编号】** 进行加密，也尽可能的做好安全防范，但是无法保证绝对安全，如果有条件，非常推荐自己部署服务器',i={setup:function(){return{md:c}}};i.render=o;n["default"]=i}}]);